    <div className="nav">
      <img src="../../../../cooking.png" alt="icon" />
      <h1>Henry Food</h1>
      <button class="dropbtn">Dropdown</button>
      <div class="dropdown-content">
        <a href="/">Home</a>
      </div>
    </div>
  );
}
